import React from 'react';
import { Link } from 'react-router-dom';

const TeacherCard = ({ teacher }) => {
  const renderStars = (rating) => {
    const stars = [];
    const fullStars = Math.floor(rating);
    const hasHalfStar = rating % 1 !== 0;

    for (let i = 0; i < fullStars; i++) {
      stars.push(<i key={i} className="fas fa-star text-yellow-400"></i>);
    }

    if (hasHalfStar) {
      stars.push(<i key="half" className="fas fa-star-half-alt text-yellow-400"></i>);
    }

    const emptyStars = 5 - Math.ceil(rating);
    for (let i = 0; i < emptyStars; i++) {
      stars.push(<i key={`empty-${i}`} className="far fa-star text-gray-300"></i>);
    }

    return stars;
  };

  return (
    <div className="teacher-card relative">
      {/* Premium Badge */}
      {teacher.isPremium && (
        <div className="absolute top-4 left-4 bg-yellow-500 text-white px-3 py-1 rounded-full text-xs font-semibold">
          <i className="fas fa-crown mr-1"></i>
          Premium
        </div>
      )}

      {/* Online Status */}
      <div className={teacher.userId?.isOnline ? "online-indicator" : "offline-indicator"}></div>

      {/* Profile Image */}
      <div className="flex flex-col items-center mb-4">
        <div className="w-20 h-20 bg-gradient-to-br from-blue-400 to-purple-500 rounded-full flex items-center justify-center text-white text-2xl font-bold mb-2">
          {teacher.userId?.name?.charAt(0).toUpperCase()}
          {teacher.userId?.surname?.charAt(0).toUpperCase()}
        </div>
        <h3 className="text-xl font-semibold text-gray-800">
          {teacher.userId?.name} {teacher.userId?.surname}
        </h3>
      </div>

      {/* Teacher Info */}
      <div className="space-y-3">
        {/* Subjects */}
        <div>
          <p className="text-sm text-gray-600 mb-1">Fənnlər:</p>
          <div className="flex flex-wrap gap-1">
            {teacher.subjects?.slice(0, 3).map((subject, index) => (
              <span
                key={index}
                className="bg-blue-100 text-blue-800 px-2 py-1 rounded-full text-xs font-medium"
              >
                {subject}
              </span>
            ))}
            {teacher.subjects?.length > 3 && (
              <span className="bg-gray-100 text-gray-600 px-2 py-1 rounded-full text-xs">
                +{teacher.subjects.length - 3}
              </span>
            )}
          </div>
        </div>

        {/* Experience */}
        <div className="flex items-center text-sm text-gray-600">
          <i className="fas fa-graduation-cap mr-2 text-blue-600"></i>
          <span>{teacher.experience} il təcrübə</span>
        </div>

        {/* Location */}
        <div className="flex items-center text-sm text-gray-600">
          <i className="fas fa-map-marker-alt mr-2 text-blue-600"></i>
          <span>{teacher.userId?.city}</span>
        </div>

        {/* Rating */}
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-1">
            {renderStars(teacher.rating)}
            <span className="text-sm text-gray-600 ml-2">
              ({teacher.totalReviews})
            </span>
          </div>
          <span className="text-lg font-bold text-green-600">
            {teacher.hourlyRate} ₼/saat
          </span>
        </div>

        {/* Grade */}
        <div className="text-center">
          <span className="bg-green-100 text-green-800 px-3 py-1 rounded-full text-sm font-medium">
            {teacher.grade}
          </span>
        </div>

        {/* Stats */}
        <div className="flex justify-between text-xs text-gray-500 border-t pt-3">
          <span>
            <i className="fas fa-eye mr-1"></i>
            {teacher.profileViews} baxış
          </span>
          <span>
            <i className="fas fa-check-circle mr-1"></i>
            {teacher.completedLessons} dərs
          </span>
        </div>

        {/* Action Buttons */}
        <div className="flex space-x-2 pt-4">
          <Link
            to={`/teacher/${teacher._id}`}
            className="flex-1 bg-blue-600 hover:bg-blue-700 text-white text-center py-2 px-4 rounded-lg transition duration-200 font-medium"
          >
            Profil
          </Link>
          <a
            href={`tel:${teacher.userId?.phone}`}
            className="flex-1 bg-green-600 hover:bg-green-700 text-white text-center py-2 px-4 rounded-lg transition duration-200 font-medium"
          >
            <i className="fas fa-phone mr-1"></i>
            Zəng
          </a>
        </div>
      </div>
    </div>
  );
};

export default TeacherCard;
